/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `detalle_compras_after_ins_tr` AFTER INSERT ON `detalle_compras`
  FOR EACH ROW
BEGIN

    DECLARE cont integer default 0;
    DECLARE ptipo_documento_id integer;
	DECLARE pprefijo varchar(5);
    DECLARE pconsecutivos integer;
    DECLARE pempresa_id integer;
    DECLARE pbodegas_id integer;
    DECLARE pnit integer;
    DECLARE pfecha DATE;
    DECLARE pvencimiento DATE;
	DECLARE pfechaact DATE;
    DECLARE done INTEGER default 0;
    DECLARE cur1 CURSOR FOR SELECT tipo_documento_id,prefijo,consecutivo,empresa_id,proveedores_id,fecha,fecha_act,bodegas_id,vencimiento FROM compras where id = NEW.compras_id;
    DECLARE CONTINUE HANDLER FOR SQLSTATE '02000' SET done = 1;
    
    open cur1;
    
    	REPEAT
	        FETCH cur1 into ptipo_documento_id,pprefijo,pconsecutivos,pempresa_id,pnit,pfecha,pfechaact,pbodegas_id,pvencimiento;
	    UNTIL done END REPEAT;
    close cur1;
		

	insert into 
    	movimientos_inventario 
        (idt
        ,tipo_documento_id
        ,prefijo
        ,consecutivos
        ,empresa_id
        ,bodegas_id
        ,nit
        ,kardex_id
        ,fecha
 	    ,fecha_act
   		,descuento	
        ,costo
        ,cantidad
        ,total
        ,anulado
        ,multiplica)
   value(new.id
        ,ptipo_documento_id
        ,pprefijo
        ,pconsecutivos
        ,pempresa_id
        ,pbodegas_id
        ,pnit
        ,NEW.kardex_id
        ,pfecha
        ,pfechaact
        ,NEW.descuento
        ,NEW.costo
        ,NEW.cantidad
        ,NEW.costo*cantidad
        ,NEW.anulado
        ,'1'
        );	
        
   SELECT count(*) into cont from cxp where  tipo_documento_id = ptipo_documento_id and prefijo = pprefijo and consecutivo = pconsecutivos  and anulado = '0';    
   
   if cont = 0 then
   	
        	insert into cxp 
            	(
                 empresa_id
                ,tipo_documento_id
                ,prefijo
                ,consecutivo
                ,fecha
                ,vencimiento
                ,total_compra
                ,creditos
                ,debitos
                ,total_pagado
                ,anulado
                ) values 
                (
                 pempresa_id
                ,ptipo_documento_id
                ,pprefijo
                ,pconsecutivos
                ,pfecha
                ,pvencimiento
                ,NEW.total
                ,0
                ,0
                ,0
                ,0
                );
    
    ELSE
        	
    	UPDATE cxp set total_compra = total_compra + new.total  where anulado = 0 and tipo_documento_id = ptipo_documento_id and prefijo = pprefijo and consecutivo = pconsecutivos;
    
    end if;
    


END */;;
DELIMITER ;
