/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `detalle_compras_after_update` AFTER UPDATE ON `detalle_compras` FOR EACH ROW BEGIN

    DECLARE suma double(12,2) default 0;
    DECLARE pbodegas_id integer default 0;
    DECLARE pfecha date;
    DECLARE pvencimiento date;
    DECLARE ptipo_documento_id integer default 0;
    declare pprefijo integer default 0;
    declare pconsecutivos varchar(50);
    DECLARE pfecha_act datetime;
    DECLARE done INTEGER default 0;
	DECLARE cur1 CURSOR FOR SELECT tipo_documento_id,prefijo,consecutivo,bodegas_id,fecha,fecha_act,vencimiento FROM compras where id = NEW.compras_id;
    DECLARE CONTINUE HANDLER FOR SQLSTATE '02000' SET done = 1;
    
    open cur1;
    
    	REPEAT
	        FETCH cur1 into ptipo_documento_id,pprefijo,pconsecutivos,pbodegas_id,pfecha,pfecha_act,pvencimiento;
	    UNTIL done END REPEAT;
        
    close cur1;
	
  
    update movimientos_inventario set 
     idt                = new.id
    ,kardex_id          = new.kardex_id
    ,bodegas_id         = pbodegas_id
    ,fecha              = pfecha
    ,fecha_act          = pfecha_act
    ,descuento	        = new.descuento
    ,costo              = new.costo
    ,cantidad           = new.cantidad
    ,total              = new.costo*new.cantidad
    ,anulado            = new.anulado
    where 
    	idt            = new.id 
        and tipo_documento_id = ptipo_documento_id 
        and prefijo = pprefijo and consecutivos = pconsecutivos 
        and anulado = 0;
        
  
	select sum(total) into suma from detalle_compras where compras_id = new.compras_id and anulado = 0;
    UPDATE cxp set total_compra = suma, fecha = pfecha , vencimiento = pvencimiento 
    where anulado = 0 
    and tipo_documento_id = ptipo_documento_id 
    and prefijo = pprefijo 
    and consecutivo = pconsecutivos;
    

END */;;
DELIMITER ;
