/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `detalle_egresos_after_update` AFTER UPDATE ON `detalle_egresos`
  FOR EACH ROW
BEGIN

DECLARE SUMA1 DOUBLE(12,2) DEFAULT 0;
DECLARE SUMA2 DOUBLE(12,2) DEFAULT 0;

select sum(total*multiplica) into SUMA1 from detalle_egresos dt where dt.cxp_id = new.cxp_id and dt.anulado = 0;
select sum(total*multiplica) into SUMA2 from detalle_egresos dt where dt.cxp_id = old.cxp_id and dt.anulado = 0;

if old.cxp_id <> '' then
	update cxp set total_pagado = SUMA2 where id = old.cxp_id;
end if;

if new.cxp_id <> '' then
	update cxp set total_pagado = SUMA1 where id = new.cxp_id;
end if;


END */;;
