  FOR EACH ROW
BEGIN

    DECLARE suma double(12,2) default 0;
    DECLARE pbodegas_id integer default 0;
    DECLARE ptipo_documento_id integer default 0;
    DECLARE pprefijo varchar(50);
    DECLARE pconsecutivos integer default 0;
    DECLARE pfecha date;
    DECLARE pfecha_act datetime;
    DECLARE done INTEGER default 0;
	DECLARE cur1 CURSOR FOR SELECT tipo_documento_id,prefijo,consecutivo,bodegas_id,fecha,fecha_act FROM entradas_especiales where id = NEW.entradas_especiales_id;
    DECLARE CONTINUE HANDLER FOR SQLSTATE '02000' SET done = 1;
    
    open cur1;
    
    	REPEAT
	        FETCH cur1 into ptipo_documento_id,pprefijo,pconsecutivos,pbodegas_id,pfecha,pfecha_act;
	    UNTIL done END REPEAT;
        
    close cur1;
	
  
    update movimientos_inventario set 
     idt                = new.id
    ,kardex_id          = new.kardex_id
    ,bodegas_id         = pbodegas_id
    ,fecha              = pfecha
    ,fecha_act          = pfecha_act
    ,costo              = new.costo
    ,cantidad           = new.cantidad
    ,total              = new.costo*new.cantidad
    ,anulado            = new.anulado
    where idt = new.id 	and tipo_documento_id = ptipo_documento_id and prefijo = pprefijo and consecutivos = pconsecutivos  and kardex_id = new.kardex_id and anulado = 0;
     

END */;;
