/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `detalle_traslados_after_update` AFTER UPDATE ON `detalle_traslados` FOR EACH ROW begin
DECLARE suma double(12,2) default 0;
    DECLARE pdesde_bodegas_id integer default 0;
	DECLARE phasta_bodegas_id integer default 0;
    DECLARE ptipo_documento_id integer default 0;
    DECLARE pprefijo varchar(50);
    DECLARE pconsecutivos integer default 0;
    DECLARE pfecha date;
    DECLARE pfecha_act datetime;
    DECLARE done INTEGER default 0;
	DECLARE cur1 CURSOR FOR SELECT tipo_documento_id,prefijo,consecutivo,desde_bodegas_id,hasta_bodegas_id,fecha,fecha_act FROM traslados where id = NEW.traslados_id;
    DECLARE CONTINUE HANDLER FOR SQLSTATE '02000' SET done = 1;
    
    open cur1;
    
    	REPEAT
	        FETCH cur1 into ptipo_documento_id,pprefijo,pconsecutivos,pdesde_bodegas_id,phasta_bodegas_id,pfecha,pfecha_act;
	    UNTIL done END REPEAT;
        
    close cur1;
	

  
    update movimientos_inventario set 
   
     kardex_id          = new.kardex_id
    ,bodegas_id         = pdesde_bodegas_id
    ,fecha              = pfecha
    ,fecha_act          = pfecha_act
    ,costo              = new.costo
    ,cantidad           = new.cantidad
    ,total              = new.costo*new.cantidad
    ,anulado            = new.anulado
    where 
    		 tipo_documento_id = ptipo_documento_id 
            and prefijo = pprefijo 
            and consecutivos = pconsecutivos  
            and kardex_id = new.kardex_id 
            and multiplica = '1'
            ;
    
    update movimientos_inventario set 
  
   	 kardex_id          = new.kardex_id
    ,bodegas_id         = phasta_bodegas_id
    ,fecha              = pfecha
    ,fecha_act          = pfecha_act
    ,costo              = new.costo
    ,cantidad           = new.cantidad
    ,total              = new.costo*new.cantidad
    ,anulado            = new.anulado
    where 
    		 tipo_documento_id = ptipo_documento_id 
            and prefijo = pprefijo and consecutivos = pconsecutivos  
            and kardex_id = new.kardex_id 
            and multiplica = '-1'
            ;
  end */;;
